import DownloadButton from "./DownloadButton"

const Header = ({ eventData }) => {
    return (
        <header className="header">
            <h1> Natural Disaster Tracker </h1>
            <DownloadButton eventData={eventData} color={"white"}/>
        </header>
    )
}

export default Header
